I have been DJing since 1981 and along the way I have been influenced by various styles. Terminator X, Scott La Rock, Hurricane, DJ Muggs, Dr. Dre, but none of them moved me more than the genious of DJ Premier of Gangstarr. I grew up in Syracuse NY. I was a better rapper than DJ. Then I met my mentor DJ Tes-1 whom is the best producer in upstate NY. We became close friends. He was practicing some doggy-paddling to an album, by Gangstarr. I went out and bought 2 of those albums and to this day Primo has been my mentor over the last 20 years as far as my beat production goes. 

My styles have been influenced by a myriad of DJ&amp;#039;s. Now that I am 37 years old, I am not making music for money. I make it for myself. I make it for you. . Music should be free.

If you like Primo, you will love this album. I threw in some of my own Primo styled beats with some accapella&amp;#039;s  on top. 

Peace,
DJ Shamrock

